import DyteMap from './DyteMap';
export default class DytePluginMap extends DyteMap {
    constructor() {
        super({
            onAddEvent: 'pluginAdded',
            onDeleteEvent: 'pluginDeleted',
        });
    }
    add(plugin, emitEvent = true) {
        return super.add(plugin, emitEvent);
    }
    delete(pluginId, emitEvent = true, removeListeners = false) {
        return super.delete(pluginId, emitEvent, removeListeners);
    }
}
